DROP TABLE IF EXISTS `t_game_license`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `t_game_license` (
  `UN_ID` int NOT NULL AUTO_INCREMENT COMMENT '库存ID',
  `GAME_CODE` varchar(255) DEFAULT NULL COMMENT '游戏代码',
  `PACKAGE_CODE` varchar(255) DEFAULT NULL COMMENT '档位标识',
  `STATUS` varchar(255) DEFAULT NULL COMMENT '库存状态："0"-可使用; "1"-已分配; "2"-已占用; "3"-已到帐; "4"-未到帐; "5"-使用失效',
  `ORDER_NO` varchar(255) DEFAULT NULL COMMENT '库存单号',
  `SRC_ORDER_NO` varchar(255) DEFAULT NULL COMMENT '原始单号',
  `RECEIPT` longtext COMMENT '客户端凭证',
  `RECEIPT_TEMPORARY` longtext COMMENT '临时客户端凭证',
  `RECEIPT_TIME` datetime DEFAULT NULL COMMENT '凭证生成时间',
  `RECEIPT_TIME_CHAR` varchar(255) DEFAULT NULL,
  `CURRENCY_CODE` varchar(255) DEFAULT NULL COMMENT '货币代码',
  `DISCOUNT` decimal(15,2) DEFAULT NULL COMMENT '库存价格',
  `CREATE_SUBACOUNT` varchar(255) DEFAULT NULL COMMENT '入库子账户',
  `CREATE_TIME` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '入库时间',
  `USE_SUBACOUNT` varchar(255) DEFAULT NULL COMMENT '使用子账户',
  `USE_TIME` datetime DEFAULT NULL COMMENT '使用时间',
  `OWNER` varchar(255) DEFAULT NULL COMMENT '所属用户',
  `SOUR` varchar(255) DEFAULT NULL COMMENT '来源',
  `INVALID_REASON` varchar(255) DEFAULT NULL,
  `DEL_FLAG` int DEFAULT '0' COMMENT '删除标记：0-未删除；1-已删除',
  PRIMARY KEY (`UN_ID`),
  UNIQUE KEY `idx_glicense_orderno` (`ORDER_NO`),
  KEY `idx_glicense_gcode` (`GAME_CODE`),
  KEY `idx_glicense_pcode` (`PACKAGE_CODE`),
  KEY `idx_glicense_owner` (`OWNER`)
) ENGINE=InnoDB AUTO_INCREMENT=125598 DEFAULT CHARSET=utf8mb3 COMMENT='存放授权数据信息';
/*!40101 SET character_set_client = @saved_cs_client */;

